lot to do. Check your mission Tab]]);	createText([[kor]],[[기다리고 있었어요, 요원님. 산타의 구조는 큰 진전이었지만, 아직 해야 할 일이 많습니다. 미션 탭을 확인하세요]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[vie]],[[Tôi đang đợi bạn đây, đặc vụ. Cuộc giải cứu ông già Noel là một bước tiến lớn nhưng vẫn còn rất nhiều việc phải làm. Kiểm tra tab nhiệm vụ của bạn]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[rus]],[[Я ждал вас, агент. Спасение Санты было большим шагом, но еще многое предстоит сделать. Проверьте вкладку своей миссии]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[tur]],[[Seni bekliyordum Ajan. Noel Baba'nın kurtarılması büyük bir adımdı ama hâlâ yapılacak çok şey var. Görev Sekmenizi kontrol edin]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[ita]],[[La stavo aspettando, agente. Il salvataggio di Babbo Natale è stato un grande passo, ma c'è ancora molto da fare. Controlla la scheda della tua missione]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[ger]],[[Ich habe auf Sie gewartet, Agent. Die Rettung des Weihnachtsmanns war ein großer Schritt, aber es gibt noch viel zu tun. Überprüfen Sie die Registerkarte „Mission“.]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[ind]],[[Aku sudah menunggumu, Agen. Penyelamatan Sinterklas merupakan sebuah langkah besar, namun masih banyak yang harus dilakukan. Periksa Tab misi Anda]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);	createText([[msa]],[[Saya telah menunggu anda, Ejen. Penyelamatan Santa adalah satu langkah besar, tetapi masih banyak yang perlu dilakukan. Semak Tab misi anda]],[[Iâ€™ve been waiting for you, Agent. Santaâ€™s rescue was a big step, but thereâ€™s still a lot to do. Check your mission Tab]]);
