createText([[cn]],[[由于黑暗领主在黑暗之地的影响，圣诞老人的魔法已经减弱。 \n 聚集你的力量，面对黑魔王，恢复魔法，拯救圣诞节！ \n 提示：与 NPC 交谈并完成任务以获得更多线索和指导]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[tw]],[[由于黑暗领主在黑暗之地的影响，圣诞老人的魔法已经减弱。 \n 聚集你的力量，面对黑魔王，恢复魔法，拯救圣诞节！ \n 提示：与 NPC 交谈并完成任务以获得更多线索和指导]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[tha]],[[เวทมนตร์ของซานต้าอ่อนลงเนื่องจากอิทธิพลของเจ้าแห่งศาสตร์มืดในดินแดนแห่งความมืด \n รวบรวมกำลังของคุณ เผชิญหน้ากับดาร์คลอร์ด และฟื้นฟูเวทมนตร์เพื่อปกป้องคริสต์มาส! \n คำแนะนำ : พูดคุยกับ NPC และทำภารกิจเพื่อรับเบาะแสและคำแนะนำเพิ่มเติม]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[esn]],[[La magia de Santa se ha debilitado debido a la influencia del Señor Oscuro en la Tierra Oscura. \n ¡Reúne fuerzas, enfréntate al Señor Oscuro y restaura la magia para salvar la Navidad! \n Sugerencia: habla con los NPC y realiza misiones para obtener más pistas y guías.]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[ptb]],[[A magia do Papai Noel enfraqueceu devido à influência do Lorde das Trevas na Terra das Trevas. \n Reúna suas forças, enfrente o Lorde das Trevas e restaure a magia para salvar o Natal! \n Dica: Fale com NPCs e faça missões para obter mais pistas e guias]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[fra]],[[La magie du Père Noël s'est affaiblie en raison de l'influence du Seigneur des Ténèbres dans le Pays des Ténèbres. \n Rassemblez vos forces, affrontez le Seigneur des Ténèbres et restaurez la magie pour sauver Noël ! \n Astuce : Parlez aux PNJ et effectuez des quêtes pour obtenir plus d'indices et de guides.]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[jpn]],[[暗黒の国の暗黒卿の影響により、サンタの魔法は弱まっています。 \n 力を集めて暗黒卿に立ち向かい、魔法を回復してクリスマスを救いましょう! \n ヒント : NPC と話し、クエストを実行して、さらなる手がかりとガイドを入手してください]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[ara]],[[لقد ضعف سحر سانتا بسبب تأثير سيد الظلام في أرض الظلام. \n اجمع قوتك وواجه سيد الظلام واستعيد السحر لإنقاذ عيد الميلاد! \n تلميح: تحدث إلى الشخصيات غير القابلة للعب وقم بالمهمة للحصول على المزيد من الأدلة والإرشادات]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[kor]],[[어둠의 땅에서 마왕의 영향력으로 인해 산타의 마법이 약해졌습니다. \n 힘을 모아 마왕과 맞서고 마법을 회복하여 크리스마스를 구하세요! \n 힌트: NPC와 대화하고 퀘스트를 수행하여 더 많은 단서와 가이드를 얻으세요.]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[vie]],[[Phép thuật của ông già Noel đã suy yếu do ảnh hưởng của Chúa tể bóng tối ở Vùng đất bóng tối. \n Tập hợp sức mạnh của bạn, đối mặt với Chúa tể bóng tối và khôi phục phép thuật để cứu Giáng sinh! \n Gợi ý: Nói chuyện với NPC và thực hiện nhiệm vụ để có thêm manh mối và hướng dẫn]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[rus]],[[Магия Санты ослабла из-за влияния Темного Лорда в Темной Стране. \n Соберитесь с силами, сразитесь с Темным Лордом и восстановите магию, чтобы спасти Рождество! \n Подсказка: поговорите с NPC и выполните квест, чтобы получить больше подсказок и подсказок.]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[tur]],[[Karanlık Lord'un Karanlık Ülkedeki etkisi nedeniyle Noel Baba'nın büyüsü zayıfladı. \n Gücünüzü toplayın, Karanlık Lord'la yüzleşin ve Noel'i kurtarmak için büyüyü yeniden sağlayın! \n İpucu: Daha Fazla İpucu ve Rehber Almak için NPC'lerle Konuşun ve Görev Yapın]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[ita]],[[La magia di Babbo Natale si è indebolita a causa dell'influenza del Signore Oscuro nella Terra Oscura. \n Raccogli le tue forze, affronta il Signore Oscuro e ripristina la magia per salvare il Natale! \n Suggerimento: parla con gli NPC ed esegui missioni per ottenere ulteriori indizi e guide]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[ger]],[[Die Magie des Weihnachtsmanns ist aufgrund des Einflusses des Dunklen Lords im Dunklen Land geschwächt. \n Sammeln Sie Ihre Kräfte, stellen Sie sich dem Dunklen Lord und stellen Sie die Magie wieder her, um Weihnachten zu retten! \n Hinweis: Sprich mit NPCs und erfülle die Quest, um mehr Hinweise und Anleitungen zu erhalten]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[ind]],[[Sihir Santa melemah karena pengaruh Pangeran Kegelapan di Tanah Kegelapan. \n Kumpulkan kekuatanmu, hadapi Pangeran Kegelapan, dan kembalikan keajaiban untuk menyelamatkan Natal! \n Petunjuk : Bicaralah dengan NPC dan Lakukan Quest untuk Mendapatkan Lebih Banyak Petunjuk dan Panduan]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);	createText([[msa]],[[Keajaiban Santa telah lemah kerana pengaruh Tuan Kegelapan di Tanah Gelap. \n Kumpulkan kekuatan anda, hadapi Tuhan Kegelapan dan pulihkan keajaiban untuk menyelamatkan Krismas! \n Petunjuk : Bercakap dengan NPC dan Lakukan Pencarian untuk Mendapatkan Lebih Banyak Petunjuk dan Panduan]],[[Santa's magic has weakened due to the Dark Lord's influence in the Dark Land. \n Gather your strength, face the Dark Lord, and restore the magic to save Christmas! \n Hint : Talk to NPCs and Do Quest to Get More Clue and Guide]]);
