createText([[cn]],[[恭喜！您成功找到并营救了圣诞老人。尽管在森林中迷路了，你的勇敢和决心拯救了这一天。]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[tw]],[[恭喜！您成功找到并营救了圣诞老人。尽管在森林中迷路了，你的勇敢和决心拯救了这一天。]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[tha]],[[ยินดีด้วย! คุณพบและช่วยเหลือซานต้าได้สำเร็จ แม้จะหลงทางอยู่ในป่า ความกล้าหาญและความมุ่งมั่นของคุณก็ช่วยกอบกู้โลกไว้ได้]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[esn]],[[¡Felicidades! Encontraste y rescataste con éxito a Santa. A pesar de estar perdido en el bosque, tu valentía y determinación salvaron el día.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[ptb]],[[Parabéns! Você encontrou e resgatou o Papai Noel com sucesso. Apesar de estar perdido na floresta, sua bravura e determinação salvaram o dia.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[fra]],[[Félicitations! Vous avez réussi à trouver et à sauver le Père Noël. Même si vous étiez perdu dans la forêt, votre courage et votre détermination ont sauvé la situation.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[jpn]],[[おめでとう！サンタさんを見つけて救出することに成功しました。森で道に迷ったにも関わらず、あなたの勇気と決意がその危機を救いました。]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[ara]],[[تهانينا! لقد نجحت في العثور على سانتا وإنقاذه. على الرغم من ضياعك في الغابة، إلا أن شجاعتك وتصميمك أنقذا الموقف.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[kor]],[[축하해요! 성공적으로 산타를 찾아 구출했습니다. 숲 속에서 길을 잃었음에도 불구하고 당신의 용기와 결단력이 그날을 구했습니다.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[vie]],[[Chúc mừng! Bạn đã tìm thấy và giải cứu thành công ông già Noel. Dù bị lạc trong rừng nhưng lòng dũng cảm và quyết tâm của bạn đã cứu được ngày đó.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[rus]],[[Поздравляем! Вы успешно нашли и спасли Санту. Несмотря на то, что вы заблудились в лесу, ваша храбрость и решимость спасли положение.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[tur]],[[Tebrikler! Noel Baba'yı başarıyla bulup kurtardın. Ormanda kaybolmanıza rağmen cesaretiniz ve kararlılığınız günü kurtardı.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[ita]],[[Congratulazioni! Hai trovato e salvato con successo Babbo Natale. Nonostante ti fossi perso nella foresta, il tuo coraggio e la tua determinazione hanno salvato la situazione.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[ger]],[[Glückwunsch! Du hast den Weihnachtsmann erfolgreich gefunden und gerettet. Obwohl Sie sich im Wald verlaufen haben, haben Ihr Mut und Ihre Entschlossenheit den Tag gerettet.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[ind]],[[Selamat! Anda berhasil menemukan dan menyelamatkan Santa. Meski tersesat di hutan, keberanian dan tekadmu menyelamatkan hari itu.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);	createText([[msa]],[[tahniah! Anda berjaya menemui dan menyelamatkan Santa. Walaupun tersesat di dalam hutan, keberanian dan keazaman anda menyelamatkan hari itu.]],[[Congratulations! You successfully found and rescued Santa. Despite being lost in the forest, your bravery and determination saved the day.]]);
