createText([[cn]],[[您成功与酋长交谈。并在卡琳的带领下绕村走一圈。现在你只需要找到狼队长以获取有关黑魔王的更多信息]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[tw]],[[您成功与酋长交谈。并在卡琳的带领下绕村走一圈。现在你只需要找到狼队长以获取有关黑魔王的更多信息]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[tha]],[[คุณคุยกับหัวหน้าได้สำเร็จ และเสร็จสิ้นการเดินชมรอบหมู่บ้านโดยการนำของเกริน ตอนนี้คุณเพียงแค่ต้องค้นหากัปตันหมาป่าเพื่อหาข้อมูลเพิ่มเติมเกี่ยวกับ Dark Lord]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[esn]],[[Habla con éxito con el jefe. Y terminé de caminar por el pueblo guiado por Karin. Ahora sólo necesitas encontrar al Capitán Wolf para obtener más información sobre El Señor Oscuro]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[ptb]],[[Você fala com sucesso com o chefe. E terminei de passear pela vila guiada por Karin. Agora você só precisa encontrar o Capitão Wolf para obter mais informações sobre o Lorde das Trevas]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[fra]],[[Vous parlez avec succès au chef. Et fini de me promener dans le village guidé par Karin. Il ne vous reste plus qu'à trouver le capitaine Wolf pour plus d'informations sur le Seigneur des Ténèbres]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[jpn]],[[首領との会話に成功しました。そしてカリンさんの案内で村の散策終了。今度はキャプテン ウルフを見つけて、暗黒卿について詳しく知る必要があります。]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[ara]],[[لقد نجحت في التحدث إلى الرئيس. وانتهيت من التجول في القرية بإرشاد من كارين. الآن كل ما عليك فعله هو العثور على الكابتن وولف لمزيد من المعلومات حول The Dark Lord]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[kor]],[[당신은 성공적으로 수석과 대화했습니다. 그리고 카린의 안내에 따라 마을 산책을 마쳤습니다. 이제 어둠의 군주에 대한 더 많은 정보를 얻으려면 울프 선장을 찾으면 됩니다.]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[vie]],[[Bạn nói chuyện thành công với Trưởng phòng. Và kết thúc chuyến đi dạo quanh làng do Karin hướng dẫn. Bây giờ bạn chỉ cần tìm Captain Wolf để biết thêm thông tin về Chúa tể bóng tối]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[rus]],[[Вы успешно поговорили с шефом. И закончили гулять по деревне под руководством Карин. Теперь вам просто нужно найти капитана Волка, чтобы получить дополнительную информацию о Темном Лорде.]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[tur]],[[Şefle Başarılı Bir Şekilde Konuşuyorsun. Ve Karin'in Rehberliğinde Köyde Gezinmeyi Bitirdik. Artık Karanlık Lord Hakkında Daha Fazla Bilgi İçin Kaptan Wolf'u Bulmanız Gerekiyor]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[ita]],[[Hai parlato con successo con il capo. E finito di passeggiare per il villaggio guidato da Karin. Ora devi solo trovare Capitan Wolf per ulteriori informazioni sul Signore Oscuro]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[ger]],[[Sie sprechen erfolgreich mit dem Chef. Und fertig mit dem von Karin geführten Spaziergang durch das Dorf. Jetzt müssen Sie nur noch Captain Wolf finden, um weitere Informationen über den Dunklen Lord zu erhalten]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[ind]],[[Anda Berhasil Berbicara dengan Chief. Dan Selesai Berjalan Keliling Desa Dipandu oleh Karin. Sekarang Anda Hanya Perlu Menemukan Kapten Wolf untuk Info Lebih Lanjut Tentang Pangeran Kegelapan]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);	createText([[msa]],[[Anda Berjaya Bercakap dengan Ketua. Dan Selesai Bersiar-siar Di Sekitar Kampung Dibimbing oleh Karin. Kini Anda Hanya Perlu Cari Kapten Serigala untuk Maklumat Lanjut Mengenai The Dark Lord]],[[You Successfully Talk to Chief. And Finished to Walk Around The Village Guided by Karin. Now You Just Need to Find Captain Wolf for More Info About The Dark Lord]]);
